import React,{useState} from 'react';
export default function App() {
  const [task, setTask] = useState([]);
  return (
    <div style={{textAlign:'center'}}>
      <h2>WEB APP TO DO</h2>
      <div>
        <form>
          Add Task :
           <input type='text' onChange={setTask}/>
        </form>
      </div>
    </div>
  );
}
